import React from "react";

function add(a, b) {
	return a + b;
}
function subtract(a, b) {
	return a - b;
}
function Multiply(a, b) {
	return a * b;
}
function divide(a, b) {
	let d = a / b;
	d = d.toFixed(2);

	return d;
}
export default add;

export { subtract, Multiply, divide };
